    "# <span style=\"color:#FE8F77;\"> 1. ASK </span> <a class=\"anchor\"  id=\"ask\"></a>\n",
    "\n",
    "## <span style=\"color:#EC3073;\">1.1 Business Task </span> <a class=\"anchor\"  id=\"sub1_1\"></a>\n",
    "\n",
    "The core objective of this business task is to analyze smart device usage data to understand how consumers engage with their health and fitness routines. By dissecting this data, we seek to identify trends and behaviors that can inform Bellabeat’s marketing strategies, ultimately leading to increased customer engagement and product improvement. The insights gleaned from this analysis will not only contribute to Bellabeat’s growth but also foster a deeper connection with its user base, aligning product offerings with consumer needs.\n",
    "\n",
    "\n",
    "## <span style=\"color:#EC3073;\">1.2 Stakeholders </span> <a class=\"anchor\"  id=\"sub1_2\"></a>\n",
    "\n",
    "* **Urška Sršen**: Co-founder and Chief Creative Officer of Bellabeat, she plays a pivotal role in shaping the company’s design and creative vision.\n",
    "* **Sando Mur**: As a mathematician and co-founder, Mur is instrumental in Bellabeat’s strategic decisions and brings a wealth of analytical expertise to the executive team.\n",
    "* **Marketing Team**: This group of data analysts, which you joined six months ago, is tasked with collecting and analyzing data to inform and refine Bellabeat’s marketing strategy. Your role as a junior data analyst involves understanding Bellabeat’s mission and business goals, and contributing to the company’s success through data-driven insights "
   ]
