    "# <span style=\"color:#FE8F77;\"> 1. PREPARE </span> <a class=\"anchor\"  id=\"prepare\"></a>\n",
    "\n",
    "## <span style=\"color:#EC3073;\">2.1 Data Sources </span> <a class=\"anchor\"  id=\"sub2_1\"></a>\n",
    "**[FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit)**: Publicly available under CC0: Public Domain on Kaggle, provided by **[Mobius](https://www.kaggle.com/arashnic)**.\n",
    "* **Content**: Data from thirty consenting Fitbit users, including minute-level activity, heart rate, and sleep monitoring.\n",
    "* **Usage**: To explore daily habits and health trends of smart device users.\n",
    "\n",
    "## <span style=\"color:#EC3073;\">2.2 Data Storage and Organization </span> <a class=\"anchor\"  id=\"sub2_2\"></a>\n",
    "* **Location**: The dataset is available on [Zenodo](http://zenodo.org/records/53894#.X9oeh3Uzaao), an open-access repository that ensures the data is stored securely and persistently.\n",
    "* **Format**: Initially in CSV format, to be read into R for manipulation and analysis.\n",
    "\n",
    "## <span style=\"color:#EC3073;\">2.3 Data Integrity and Credibility </span> <a class=\"anchor\"  id=\"sub2_3\"></a>\n",
    "* **Verification**: The integrity of the data can be verified by checking the consistency of export session IDs and timestamps across the dataset.\n",
    "* **Variability**: Acknowledge the variation in the dataset due to different Fitbit models and user tracking behaviors.\n",
    "\n",
    "## <span style=\"color:#EC3073;\">2.4 Addressing Limitations </span> <a class=\"anchor\"  id=\"sub2_4\"></a>\n",
    "* **Complementary Data**: Additional datasets may be sourced to supplement the Fitbit data, addressing any gaps or limitations identified.\n",
    "* **Privacy and Licensing**: All data used will adhere to licensing agreements, and any personal information will be anonymized to protect user privacy.\n",
    "\n",
    "## <span style=\"color:#EC3073;\">2.5 Data Preparation Tasks </span> <a class=\"anchor\"  id=\"sub2_5\"></a>\n",
    "* **Download and Store**: Securely download the dataset from Kaggle and store it in an organized manner.\n",
    "* **Identify Organization**: Examine the dataset’s structure to understand how it’s organized and plan for its transformation.\n",
    "* **Sort and Filter**: Clean the dataset by sorting and filtering according to the research questions and analysis needs.\n",
    "* **Assess Credibility**: Evaluate the data’s source, collection methods, and the consent process to ensure its reliability.\n",
    "\n",
    "## <span style=\"color:#EC3073;\">2.6 Deliverable </span> <a class=\"anchor\"  id=\"sub2_6\"></a>\n",
    "A detailed description of the data source, including how it was collected, stored, organized, and prepared for analysis, with an emphasis on addressing any limitations and ensuring the ethical use of personal data.\n",
    "\n",
    "This section should be included in your R notebook to document the data preparation process, ensuring transparency and reproducibility of your analysis."
   ]
