   "source": [
    "# Convert the dates to Date type\n",
    "dailySleep$SleepDay <- as.Date(dailySleep$SleepDay, format = \"%m/%d/%Y\")\n",
    "dailyActivity$ActivityDate <- as.Date(dailyActivity$ActivityDate, format = \"%m/%d/%Y\")\n",
    "\n",
    "# Rename 'SleepDay' to 'ActivityDate' in the dailySleep dataset\n",
    "names(dailySleep)[names(dailySleep) == \"SleepDay\"] <- \"ActivityDate\"\n",
    "\n",
    "# Select the required columns from the dailySleep dataset\n",
    "selectedSleepData <- dailySleep[, c(\"Id\", \"ActivityDate\", \"TotalSleepRecords\", \"TotalMinutesAsleep\", \"TotalTimeInBed\")]\n",
    "\n",
    "# Merge the dataset\n",
    "dailyActivity <- merge(dailyActivity, selectedSleepData, by = c(\"ActivityDate\", \"Id\"), all = TRUE)\n",
    "\n",
    "# Convert the dates back to the format \"m/d/Y\"\n",
    "dailyActivity$ActivityDate <- format(dailyActivity$ActivityDate, \"%m/%d/%Y\")"
   ]
  },
