    "# Convert the \"Time\" column to a POSIXct object\n",
    "heartrateSeconds$Time <- as.POSIXct(heartrateSeconds$Time, format = \"%m/%d/%Y %I:%M:%S %p\")\n",
    "\n",
    "# Create a new column \"ActivityMinute\" with rounded minute values\n",
    "heartrateSeconds$ActivityMinute <- floor_date(heartrateSeconds$Time, \"minute\")\n",
    "\n",
    "# Group by 'Id' and minute, then summarize heart rate statistics\n",
    "heartrateMinute <- heartrateSeconds %>%\n",
    "  group_by(Id, ActivityMinute) %>%\n",
    "  summarize(minHR = min(Value), meanHR = mean(Value), maxHR = max(Value))\n",
    "\n",
    "# Merge the data frames by 'Id' and 'ActivityMinute'\n",
    "minuteActivity <- inner_join(heartrateMinute, minuteActivity, by = c(\"Id\", \"ActivityMinute\"))\n",
    "\n",
    "# Print the summary\n",
    "print(minuteActivity)"
   ]
  },
