   "source": [
    "# Filter the data to include only rows with TotalDistance > 0\n",
    "active_users_day <- dailyActivity %>% \n",
    "  filter(TotalDistance > 0) %>%\n",
    "  group_by(ActivityDate) %>%\n",
    "  summarise(count = n_distinct(Id))\n",
    "\n",
    "# Create the plot\n",
    "ggplot(active_users_day, aes(x = ActivityDate, y = count)) +\n",
    "  geom_col(fill = \"#FE8F77\") +\n",
    "  labs(title = \"Count of Unique IDs Logging TotalDistance > 0\",\n",
    "       x = \"Date\",\n",
    "       y = \"Number of Users Tracked Traveling a Distance\")"
   ]
  },
