   "source": [
    "ggplot(dailyActivity, aes(x = ActivityDate, y = TotalDistance)) +\n",
    "  geom_line(color = \"#FE8F77\") + # Line plot to connect the points\n",
    "  geom_point(color = \"#EC3073\", alpha = 0.6) + # Adjusted point transparency\n",
    "  geom_jitter(color = \"#EC3073\", width = 0.1, alpha = 0.6) + # Added jittering\n",
    "  geom_smooth(se = FALSE, color = \"#FE8F77\") + # Added a smoothing line\n",
    "  labs(title = \"Time Series Plot of Total Distance of 35 Individuals\",\n",
    "       x = \"Date\",\n",
    "       y = \"Total Distance Covered\") +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1), # Improve x-axis readability\n",
    "        plot.background = element_rect(fill = \"white\"), # White background\n",
    "        panel.grid.major = element_line(color = \"#f0f0f0\"), # Lighter grid lines\n",
    "        panel.grid.minor = element_blank()) # Remove minor grid lines"
   ]
