   "source": [
    "ggplot(activity_long, aes(x = value, fill = variable)) +\n",
    "  geom_histogram(binwidth = 10, alpha = 0.6) + # Adjusted binwidth and added transparency\n",
    "  facet_wrap(~ variable, scales = \"fixed\") + # Uniform y-axis scales\n",
    "  labs(title = \"Faceted Histogram of Activity Minutes\",\n",
    "       x = \"Minutes\",\n",
    "       y = \"Frequency\",\n",
    "       fill = \"Activity Type\") + # Added legend title\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"bottom\")"
   ]
