    "* The histogram reveals that individuals have varying levels of physical activity, with the majority of activity minutes falling into the “Fairly Active Minutes” category.\n",
    "* This suggests that while very intense activity is less common, a moderate level of activity is more regularly achieved among the individuals tracked.\n",
    "* The distribution also indicates that light activity is fairly consistent but doesn’t reach the same frequency as moderate activity."
