   "source": [
    "distance_long <- pivot_longer(dailyActivity, \n",
    "                              cols = c(\"VeryActiveDistance\", \"ModeratelyActiveDistance\", \"LightActiveDistance\"),\n",
    "                              names_to = \"ActivityType\",\n",
    "                              values_to = \"Distance\")\n",
    "\n",
    "# Create the stacked bar chart\n",
    "# Assuming 'distance_long' is your reshaped data frame\n",
    "ggplot(distance_long, aes(x = Id, y = Distance, fill = ActivityType)) +\n",
    "  geom_bar(stat = \"identity\", position = \"stack\") +\n",
    "  scale_fill_manual(values = c(\"VeryActiveDistance\" = \"#EC3073\", \n",
    "                               \"ModeratelyActiveDistance\" = \"#FE8F77\",\n",
    "                               \"LightActiveDistance\" = \"#FEBF77\")) + # Adjust the colors as needed\n",
    "  labs(title = \"Stacked Bar Chart of Activity Distances for Each User\",\n",
    "       x = \"User ID\",\n",
    "       y = \"Distance (in miles)\") +\n",
    "  theme_minimal()"
   ]
