   "source": [
    "#Lets add color coding to differentiate between different ranges of steps, adjusted the bubble sizes, and included a theme for better aesthetics:\n",
    "\n",
    "# Create a factor variable for color coding based on 'Steps'\n",
    "minuteActivity$StepRange <- cut(minuteActivity$Steps,\n",
    "                                breaks = c(-Inf, 50, 100, 150, Inf),\n",
    "                                labels = c(\"0-50\", \"51-100\", \"101-150\", \"150+\"))\n",
    "\n",
    "ggplot(minuteActivity, aes(x = METs, y = Calories, size = Steps, color = StepRange)) +\n",
    "    geom_point(alpha = 0.5, shape = 21, stroke = 2) + # Set transparency and add border to bubbles\n",
    "    scale_size_continuous(name = \"Total Steps per Minute\", range = c(1, 10)) + # Adjust the size range\n",
    "    scale_color_manual(values = c(\"0-50\" = \"#ADD8E6\", \"51-100\" = \"#FEBF77\", \"101-150\" = \"#FE8F77\", \"150+\" = \"#EC3073\"),\n",
    "                       name = \"Step Range\") + # Color coding\n",
    "    labs(x = \"METs\", y = \"Calories Burned\", title = \"Bubble Chart of Calories vs. METs per Minute\") +\n",
    "    theme_minimal() # Use a minimal theme for a cleaner look"
   ]
  },
