   "source": [
    "ggplot(hourlyActivity, aes(x = ActivityHour, y = TotalIntensity)) +\n",
    "  geom_area(fill = \"#EC3073\", alpha = 0.5) + # Fill color and transparency\n",
    "  theme_minimal() + # Minimal theme\n",
    "  labs(title = \"Area Chart of Total Intensity Over Time\",\n",
    "       x = \"Time\",\n",
    "       y = \"Total Intensity\")"
   ]
