   "source": [
    "* The heatmap indicates positive correlations between the variables related to physical activity, with no significant negative correlations observed.\n",
    "* Darker reds suggest stronger relationships, particularly between step count and calorie expenditure.\n",
    "* The absence of purple hues confirms that all measured activities tend to increase together, rather than inversely."
