   "source": [
    "# Calculate the correlation matrix\n",
    "cor_matrix_minute <- cor(minuteActivity[, sapply(minuteActivity, is.numeric)])\n",
    "\n",
    "# Melt the correlation matrix\n",
    "melted_cor_matrix_minute <- melt(cor_matrix_minute)\n",
    "\n",
    "# Create the heatmap\n",
    "ggplot(data = melted_cor_matrix_minute, aes(Var1, Var2, fill = value)) +\n",
    "  geom_tile() +\n",
    "  scale_fill_gradient2(low = \"blue\", high = \"red\", mid = \"white\", \n",
    "                       midpoint = 0, limit = c(-1,1), space = \"Lab\", \n",
    "                       name=\"Pearson\\nCorrelation\") +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, vjust = 1, size = 12, hjust = 1),\n",
    "        axis.text.y = element_text(size = 12)) +\n",
    "  labs(x = '', y = '', title = 'Correlation Matrix Heatmap', fill = 'Correlation') "
   ]
  },
